import React from "react";
import "../style/css/style.css";
import Header from "./Header";
import ArticleSlider from "./ArticleSlider";
import Main from "./Main";
import Footer from "./Footer";

const App = () => {
    return (
        <div>
            <Header />
            <ArticleSlider />
            <Main />
            <Footer />
        </div>
    );
};

export default App;
